import React from 'react';
import tripListData from './TripListData.js'

import Gdansk from './Gdańsk.jpg'
import Sopot from './Sopot.jpg'
import Gdynia from './Gdynia.jpg'


export default function MainPhoto ({tripListData}){
    return (
        <>
            { tripListData.city === "Gdynia" ? <img src={Gdynia} alt="complex"  /> : null }
            { tripListData.city === "Gdańsk" ? <img src={Gdynia} alt="complex"  /> : null }

        </>
    );
}
